  <>
  <div  styles={{ backgroundImage:`url{https://images.pexels.com/photos/34153/pexels-photo.jpg?auto=compress&cs=tinysrgb&h=350"}`}}>  
  <img src={image}  />    
    </div>
  </>
  )
}
export default Login;
